import React, { Component } from 'react';
import BottomNavRightItem from 'BottomNavRightItem';
import FcSearch from 'react-icons/fc'
class BottomNavRight extends Component {

    render() {
        return (
            <div className="col-lg-6 col-md-6 col-sm-12 col-xs-12 attr-nav">
                <ul className="bottom-nav-list-inline2">
                    <BottomNavRightItem href="know-more.html" className="nav-link-hover" bottom='اعرف اكتر' />
                    <BottomNavRightItem href="latest-news.html" className="nav-link-hover" bottom='اخر الاخبار' />
                    <BottomNavRightItem href="showroom.html" className="nav-link-hover" bottom='العروض' />
                    <li className="dropdown"><a href="#" className="nav-link dropdown-toggle arrow nav-link-hover" data-toggle="dropdown">المركبات</a></li>
                    <ul className="dropdown-menu">
                        <DropdownItem className="drobmenu-li" href="new-cars.html" buttom='سيارات جديده' />
                        <DropdownItem className="drobmenu-li" href="used-cars.html" buttom='سيارات مستعمله' />
                        <DropdownItem className="drobmenu-li" href="motors.html" buttom='موتوسيكلات' />
                        <DropdownItem className="drobmenu-li-noborder" href="boats.html" buttom='قوارب' />
                    </ul>
                    <BottomNavRightItem href="home.html" className="active nav-link-hover" bottom='الرائيسية' />
                   <li className="search"><FcSearch/></li>
                </ul>
            </div>
        );
    }
}

export default BottomNavRight;
